#! /bin/sh
set -e

gradlew_content=""

gradle_wrapper_properties_content="distributionBase=GRADLE_USER_HOME\\ndistributionPath=wrapper/dists\\ndistributionUrl=https\://services.gradle.org/distributions/gradle-7.1-bin.zip\\nzipStoreBase=GRADLE_USER_HOME\\nzipStorePath=wrapper/dists\\n"

gradle_wrapper_jar_content=""

build_gradle_content='import org.jetbrains.kotlin.gradle.tasks.KotlinCompile
import org.gradle.api.tasks.testing.logging.TestExceptionFormat

plugins {
    kotlin("jvm") version "1.6.0"
    application
}

group = "me.mud"
version = "1.0-SNAPSHOT"

repositories {
    mavenCentral()
}

dependencies {
    testImplementation(kotlin("test"))
}

tasks.test {
    useJUnit()
    testLogging {
        events("PASSED", "FAILED", "SKIPPED")
        exceptionFormat = TestExceptionFormat.FULL
        showStandardStreams = true
        showStackTraces = true
    }
}

tasks.withType<KotlinCompile>() {
    kotlinOptions.jvmTarget = "1.8"
    kotlinOptions.allWarningsAsErrors = true
}

application {
    mainClass.set("MainKt")
}'

case "$1" in
  "new") 
    if [ ! -d "$2" ]; then
      mkdir $2
      echo "$build_gradle_content" > $2/build.gradle.kts
      echo "rootProject.name = \"$2\"" > $2/settings.gradle.kts
      echo $gradlew_content | base64 -d  > $2/gradlew
      chmod +x $2/gradlew
      echo "kotlin.code.style=official" > $2/gradle.properties
      mkdir -p $2/gradle/wrapper
      echo $gradle_wrapper_properties_content > $2/gradle/wrapper/gradle-wrapper.properties
      echo $gradle_wrapper_jar_content | base64 -d > $2/gradle/wrapper/gradle-wrapper.jar
      # Main source set
      mkdir -p $2/src/main/kotlin
      echo "fun main() {\n\tprintln(\"Hello World!\")\n}" > $2/src/main/kotlin/Main.kt
      # Test SourceSet
      mkdir -p $2/src/main/resources
      mkdir -p $2/src/test/kotlin
      mkdir -p $2/src/test/resources
      echo 'import org.junit.Test\nimport org.junit.Assert\n\nclass MainTest {\n\t@Test\n\tfun `Example 1`() {\n\t\tval expected = false\n\t\tAssert.assertEquals(expected, true)\n\t}\n}\n' > $2/src/test/kotlin/MainTest.kt
      
    else 
      echo "already exists!!"
      exit 0
    fi
  ;;
  "new:sql")
    if [ ! -d "$2" ]; then
      mkdir $2
      touch "$2/Schema.sql"
      echo "/*  */" > $2/Main.sql
    else
      echo "already exists!!"
    fi
  ;;
esac
